import { Text, View } from 'react-native';

const style = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});

const App = () => {
  return (
    <View style={style.container}>
      <Text>Some text</Text>
    </View>
  );
};

export default App;
